import{_ as e,c as l,o as i,al as r}from"./chunks/framework.5cuxq5ua.js";const f=JSON.parse('{"title":"2026-01","description":"","frontmatter":{"outline":[1,8]},"headers":[],"relativePath":"life/日记/2026年日记.md","filePath":"life/日记/2026年日记.md","lastUpdated":1770048650000}'),h={name:"life/日记/2026年日记.md"};function t(n,a,d,o,s,_){return i(),l("div",null,[...a[0]||(a[0]=[r('<h1 id="_2026-01" tabindex="-1">2026-01 <a class="header-anchor" href="#_2026-01" aria-label="Permalink to “2026-01”">​</a></h1><h2 id="_2026-01-31-21-44-星期六" tabindex="-1">2026-01-31 21:44 星期六 <a class="header-anchor" href="#_2026-01-31-21-44-星期六" aria-label="Permalink to “2026-01-31 21:44 星期六”">​</a></h2><h3 id="骑车水声水库🚴🏻‍♀️" tabindex="-1">骑车水声水库🚴🏻‍♀️ <a class="header-anchor" href="#骑车水声水库🚴🏻‍♀️" aria-label="Permalink to “骑车水声水库🚴🏻‍♀️”">​</a></h3><ul><li>这段路还是很有难度的，是我在strava上第二的爬升高度。有几个坡差点要上不去。沿着水库的路也是起起伏伏，不是平路，还好是逆时针环水库，顺时针的话，我可能上不来那座山，菜腿，哈哈哈。</li></ul><h2 id="_2026-01-30-22-05-星期五" tabindex="-1">2026-01-30 22:05 星期五 <a class="header-anchor" href="#_2026-01-30-22-05-星期五" aria-label="Permalink to “2026-01-30 22:05 星期五”">​</a></h2><h3 id="跟金爱一起逛山姆-🏪" tabindex="-1">跟金爱一起逛山姆 🏪 <a class="header-anchor" href="#跟金爱一起逛山姆-🏪" aria-label="Permalink to “跟金爱一起逛山姆 🏪”">​</a></h3><ul><li>跟金爱一起逛了山姆，逛完在外面一起吃了牛肉卷跟披萨，牛肉很多，下次去逛的时候，提前带一个分装盒，想买什么可以分着一起买。</li></ul><h2 id="_2026-01-25-21-49-星期六" tabindex="-1">2026-01-25 21:49 星期六 <a class="header-anchor" href="#_2026-01-25-21-49-星期六" aria-label="Permalink to “2026-01-25 21:49 星期六”">​</a></h2><h3 id="香港麦理浩径徒步-🏃🏻‍♀️" tabindex="-1">香港麦理浩径徒步 🏃🏻‍♀️ <a class="header-anchor" href="#香港麦理浩径徒步-🏃🏻‍♀️" aria-label="Permalink to “香港麦理浩径徒步 🏃🏻‍♀️”">​</a></h3><ul><li>爬了好几座山，累是真的累，风景好是真的好，海水太蓝了，远远的望着那一片白色的沙滩蓝色的海水真实美极了，本来那天温度不是很高，但是在徒步几乎没有树荫，非常的晒，一路上都是尘土。</li><li>路上厕所比较少，但又很热，又不敢多喝水。</li><li>很开心，又挑战了一段很难走的路。看到了那么美丽的风景，跟好朋友们一起徒步，看到那么美丽的风景，真是人生一大美事。</li></ul><h2 id="_2026-01-18-22-09-星期天" tabindex="-1">2026-01-18 22:09 星期天 <a class="header-anchor" href="#_2026-01-18-22-09-星期天" aria-label="Permalink to “2026-01-18 22:09 星期天”">​</a></h2><h3 id="《翠湖》、徒步黄埔区好几个公园" tabindex="-1">《翠湖》、徒步黄埔区好几个公园 <a class="header-anchor" href="#《翠湖》、徒步黄埔区好几个公园" aria-label="Permalink to “《翠湖》、徒步黄埔区好几个公园”">​</a></h3><ul><li>周六在星寰看了电影《翠湖》，很不错，《昆明》这首歌也好好听。<a href="/read/观影阅读记录.html#_2026">翠湖</a></li><li>徒步路线也是在小红书上搜到的，路线不长，串起了好几个黄埔区科学城这边的公园，路程不长8Km左右，爬升也不大，散散步，很舒服。</li></ul><h2 id="_2026-01-12-21-43-星期一" tabindex="-1">2026-01-12 21:43 星期一 <a class="header-anchor" href="#_2026-01-12-21-43-星期一" aria-label="Permalink to “2026-01-12 21:43 星期一”">​</a></h2><h3 id="新办公室一周-爱酱博客-动人的旋律" tabindex="-1">新办公室一周 爱酱博客 动人的旋律 <a class="header-anchor" href="#新办公室一周-爱酱博客-动人的旋律" aria-label="Permalink to “新办公室一周 爱酱博客 动人的旋律”">​</a></h3><ul><li>新年的第一个星期，就在努力适应新环境中度过，新的办公室，适应网络，适应新的工作节奏。新办公室旁边在施工，咚咚咚的声音，每天都很吵，还在打地基，如果打好了应该就没那么难受了。不能用互联网确实比较麻烦，现在都在积极融入AI，用不了网感觉都在倒退一样。坐到领导旁边，现在感觉也还好，领导人很好，时不时的递过来一个水果，零食啥的，他的话感觉也很多，领导心态真不错，哈哈哈。这边的工位很宽，脚放直之后，也不会踢到对面的同事。还挺好的。就是感觉装修的味道还是没有完全散去，也不知道对身体到底会造成多大的影响。</li><li>今天还看了爱酱的博客，很不错，她的动手能力太强了，一步步的用着AI搭建起来，真厉害。看了她的博客内容，感觉她是一个很积极的人，写的文字都能感觉到向上，很有活力，真不错，可以看看这种有活力的文字。</li><li>上周六的时候发现一首非常好听的歌，是韩语歌，翻译成中文是《致犹豫的恋人们》，听不懂在唱什么，但是旋律就很打动我，一下子让我想到了电影《初吻》的经典画面，戴上耳机播放着《Reality》世界都安静了。中午在办公室两只耳朵都带着耳机，一直循环这首歌，安安静静的迁移博客也好，看书也好，好舒服。</li></ul>',16)])])}const b=e(h,[["render",t]]);export{f as __pageData,b as default};
